/*******************************************************************************
 * @description    : 조회된 자료를 Grid의 Dataset에 Setting
*******************************************************************************/
function f_setGridData()
{
    ds_list.ClearData();
    if (ds_list.rowcount == 0) {;
        ds_list.AddRow();
    }

    var sCnt;             // 조회된 Row만큼 Grid에 표시하기 위한 For-Loop Index
    var sLine; 
    var pPreStl     = 0;
    var pPreTot     = 0;
    var pStlCnt     = 0;
    var pTotCnt     = 0;
    var pStlAdd     = 0;
    var pTotAdd     = 0;
    var pStlRate    = 0;
    var pTotRate    = 0;
    var pStlQty     = 0;
    var pStlAvg     = 0;
    var pStlSaleQty = 0;
    var pTotQty     = 0;
    var pTotAvg     = 0;
    var pTotSaleQty = 0;

    grd_list.Redraw = false;

    // 전월 기준
    For(rCnt  = 1; rCnt < 20; rCnt++) {
		sLine = Lpad(rCnt, "0", 2);
        ds_list.SetColumn(0, "LINE" + sLine + "A_0D", ds_DealIncrePrev.GetColumn(0, "line" + sLine + "_stl_deal_cnt"));
        ds_list.SetColumn(0, "LINE" + sLine + "A_0E", ds_DealIncrePrev.GetColumn(0, "line" + sLine + "_stl_sale_deal_cnt"));
        ds_list.SetColumn(0, "LINE" + sLine + "B_0D", ds_DealIncrePrev.GetColumn(0, "line" + sLine + "_tot_deal_cnt"));
        ds_list.SetColumn(0, "LINE" + sLine + "B_0E", ds_DealIncrePrev.GetColumn(0, "line" + sLine + "_tot_sale_deal_cnt"));
    }

    // 전월대비 증감율
    // 최종 조회 주간 자료를 Temp Dataset에 복사하여 계산
    ds_DealIncreBase.Clear();
    switch(FV_COLUMN)
    {
        case 1:
            ds_DealIncreBase.Copy(ds_DealIncre1st);
            break;
        case 2:
            ds_DealIncreBase.Copy(ds_DealIncre2nd);
            break;
        case 3:
            ds_DealIncreBase.Copy(ds_DealIncre3rd);
            break;
        case 4:
            ds_DealIncreBase.Copy(ds_DealIncre4th);
            break;
        case 5:
            ds_DealIncreBase.Copy(ds_DealIncre5th);
            break;
        case 6:
            ds_DealIncreBase.Copy(ds_DealIncre6th);
            break;
    }

    For(rCnt  = 1; rCnt < 20; rCnt++) {
		sLine = Lpad(rCnt, "0", 2);

        pPreStl = ToNumber(ds_list.GetColumn(0, "LINE" + sLine + "A_0D"));
        pPreTot = ToNumber(ds_list.GetColumn(0, "LINE" + sLine + "B_0D"));
        pStlCnt = ToNumber(ds_DealIncreBase.GetColumn(0, "line" + sLine + "_stl_deal_cnt"));
        pTotCnt = ToNumber(ds_DealIncreBase.GetColumn(0, "line" + sLine + "_tot_deal_cnt"));
        pStlAdd = pStlCnt - pPreStl;
        pTotAdd = pTotCnt - pPreTot;
        if (uf_isNull(pPreStl) || pPreStl == 0) {
            pStlRate = 0;
        } else {
            pStlRate = round(pStlAdd * 100 / pPreStl, 2);
        }
        if (uf_isNull(pPreTot) || pPreTot == 0) {
            pTotRate = 0;
        } else {
            pTotRate = round(pTotAdd * 100 / pPreTot, 2);
        }

        ds_list.SetColumn(0, "LINE" + sLine + "A_0F", pStlCnt);
        ds_list.SetColumn(0, "LINE" + sLine + "A_0G", pStlAdd);
        ds_list.SetColumn(0, "LINE" + sLine + "A_0H", pStlRate);
        ds_list.SetColumn(0, "LINE" + sLine + "B_0F", pTotCnt);
        ds_list.SetColumn(0, "LINE" + sLine + "B_0G", pTotAdd);
        ds_list.SetColumn(0, "LINE" + sLine + "B_0H", pTotRate);
    }

    // 1주차 자료
    For(rCnt  = 1; rCnt < 20; rCnt++) {
		sLine = Lpad(rCnt, "0", 2);

        // 판매점수 / 증감 / 증감율
        pPreStl = ToNumber(ds_list.GetColumn(0, "LINE" + sLine + "A_0D"));
        pPreTot = ToNumber(ds_list.GetColumn(0, "LINE" + sLine + "B_0D"));
        pStlCnt = ToNumber(ds_DealIncre1st.GetColumn(0, "line" + sLine + "_stl_deal_cnt"));
        pTotCnt = ToNumber(ds_DealIncre1st.GetColumn(0, "line" + sLine + "_tot_deal_cnt"));
        pStlAdd = pStlCnt - pPreStl;
        pTotAdd = pTotCnt - pPreTot;
        if (uf_isNull(pPreStl) || pPreStl == 0) {
            pStlRate = 0;
        } else {
            pStlRate = round(pStlAdd * 100 / pPreStl, 2);
        }
        if (uf_isNull(pPreTot) || pPreTot == 0) {
            pTotRate = 0;
        } else {
            pTotRate = round(pTotAdd * 100 / pPreTot, 2);
        }

        // 판매점수 / 판매량 / 점당판매량
        pStlQty     = ToNumber(ds_DealIncre1st.GetColumn(0, "line" + sLine + "_stl_sale_deal_cnt"));
        pStlSaleQty = ToNumber(ds_DealIncre1st.GetColumn(0, "line" + sLine + "_stl_deal_sale_qty"));
        pTotQty     = ToNumber(ds_DealIncre1st.GetColumn(0, "line" + sLine + "_tot_sale_deal_cnt"));
        pTotSaleQty = ToNumber(ds_DealIncre1st.GetColumn(0, "line" + sLine + "_tot_deal_sale_qty"));
        if (uf_isNull(pStlQty) || pStlQty == 0) {
            pStlAvg = 0;
        } else {
            pStlAvg = round(pStlSaleQty / pStlQty);
        }
        if (uf_isNull(pTotQty) || pTotQty == 0) {
            pTotAvg = 0;
        } else {
            pTotAvg = round(pTotSaleQty / pTotQty);
        }

        ds_list.SetColumn(0, "LINE" + sLine + "A_11", pStlCnt);
        ds_list.SetColumn(0, "LINE" + sLine + "A_12", pStlAdd);
        ds_list.SetColumn(0, "LINE" + sLine + "A_13", pStlRate);
        ds_list.SetColumn(0, "LINE" + sLine + "A_14", pStlQty);
        ds_list.SetColumn(0, "LINE" + sLine + "A_15", pStlSaleQty);
        ds_list.SetColumn(0, "LINE" + sLine + "A_16", pStlAvg);
        ds_list.SetColumn(0, "LINE" + sLine + "B_11", pTotCnt);
        ds_list.SetColumn(0, "LINE" + sLine + "B_12", pTotAdd);
        ds_list.SetColumn(0, "LINE" + sLine + "B_13", pTotRate);
        ds_list.SetColumn(0, "LINE" + sLine + "B_14", pTotQty);
        ds_list.SetColumn(0, "LINE" + sLine + "B_15", pTotSaleQty);
        ds_list.SetColumn(0, "LINE" + sLine + "B_16", pTotAvg);
    }

    // 2주차 자료
    For(rCnt  = 1; rCnt < 20; rCnt++) {
		sLine = Lpad(rCnt, "0", 2);

        // 판매점수 / 증감 / 증감율
        pPreStl = ToNumber(ds_list.GetColumn(0, "LINE" + sLine + "A_11"));
        pPreTot = ToNumber(ds_list.GetColumn(0, "LINE" + sLine + "B_11"));
        pStlCnt = ToNumber(ds_DealIncre2nd.GetColumn(0, "line" + sLine + "_stl_deal_cnt"));
        pTotCnt = ToNumber(ds_DealIncre2nd.GetColumn(0, "line" + sLine + "_tot_deal_cnt"));
        pStlAdd = pStlCnt - pPreStl;
        pTotAdd = pTotCnt - pPreTot;
        if (uf_isNull(pPreStl) || pPreStl == 0) {
            pStlRate = 0;
        } else {
            pStlRate = round(pStlAdd * 100 / pPreStl, 2);
        }
        if (uf_isNull(pPreTot) || pPreTot == 0) {
            pTotRate = 0;
        } else {
            pTotRate = round(pTotAdd * 100 / pPreTot, 2);
        }

        // 판매점수 / 판매량 / 점당판매량
        pStlQty     = ToNumber(ds_DealIncre2nd.GetColumn(0, "line" + sLine + "_stl_sale_deal_cnt"));
        pStlSaleQty = ToNumber(ds_DealIncre2nd.GetColumn(0, "line" + sLine + "_stl_deal_sale_qty"));
        pTotQty     = ToNumber(ds_DealIncre2nd.GetColumn(0, "line" + sLine + "_tot_sale_deal_cnt"));
        pTotSaleQty = ToNumber(ds_DealIncre2nd.GetColumn(0, "line" + sLine + "_tot_deal_sale_qty"));
        if (uf_isNull(pStlQty) || pStlQty == 0) {
            pStlAvg = 0;
        } else {
            pStlAvg = round(pStlSaleQty / pStlQty);
        }
        if (uf_isNull(pTotQty) || pTotQty == 0) {
            pTotAvg = 0;
        } else {
            pTotAvg = round(pTotSaleQty / pTotQty);
        }

        ds_list.SetColumn(0, "LINE" + sLine + "A_21", pStlCnt);
        ds_list.SetColumn(0, "LINE" + sLine + "A_22", pStlAdd);
        ds_list.SetColumn(0, "LINE" + sLine + "A_23", pStlRate);
        ds_list.SetColumn(0, "LINE" + sLine + "A_24", pStlQty);
        ds_list.SetColumn(0, "LINE" + sLine + "A_25", pStlSaleQty);
        ds_list.SetColumn(0, "LINE" + sLine + "A_26", pStlAvg);
        ds_list.SetColumn(0, "LINE" + sLine + "B_21", pTotCnt);
        ds_list.SetColumn(0, "LINE" + sLine + "B_22", pTotAdd);
        ds_list.SetColumn(0, "LINE" + sLine + "B_23", pTotRate);
        ds_list.SetColumn(0, "LINE" + sLine + "B_24", pTotQty);
        ds_list.SetColumn(0, "LINE" + sLine + "B_25", pTotSaleQty);
        ds_list.SetColumn(0, "LINE" + sLine + "B_26", pTotAvg);
    }

    // 3주차 자료
    For(rCnt  = 1; rCnt < 20; rCnt++) {
		sLine = Lpad(rCnt, "0", 2);

        // 판매점수 / 증감 / 증감율
        pPreStl = ToNumber(ds_list.GetColumn(0, "LINE" + sLine + "A_21"));
        pPreTot = ToNumber(ds_list.GetColumn(0, "LINE" + sLine + "B_21"));
        pStlCnt = ToNumber(ds_DealIncre3rd.GetColumn(0, "line" + sLine + "_stl_deal_cnt"));
        pTotCnt = ToNumber(ds_DealIncre3rd.GetColumn(0, "line" + sLine + "_tot_deal_cnt"));
        pStlAdd = pStlCnt - pPreStl;
        pTotAdd = pTotCnt - pPreTot;
        if (uf_isNull(pPreStl) || pPreStl == 0) {
            pStlRate = 0;
        } else {
            pStlRate = round(pStlAdd * 100 / pPreStl, 2);
        }
        if (uf_isNull(pPreTot) || pPreTot == 0) {
            pTotRate = 0;
        } else {
            pTotRate = round(pTotAdd * 100 / pPreTot, 2);
        }

