        pStlQty     = ToNumber(ds_DealIncre3rd.GetColumn(0, "line" + sLine + "_stl_sale_deal_cnt"));
        pStlSaleQty = ToNumber(ds_DealIncre3rd.GetColumn(0, "line" + sLine + "_stl_deal_sale_qty"));
        pTotQty     = ToNumber(ds_DealIncre3rd.GetColumn(0, "line" + sLine + "_tot_sale_deal_cnt"));
        pTotSaleQty = ToNumber(ds_DealIncre3rd.GetColumn(0, "line" + sLine + "_tot_deal_sale_qty"));
        if (uf_isNull(pStlQty) || pStlQty == 0) {
            pStlAvg = 0;
        } else {
            pStlAvg = round(pStlSaleQty / pStlQty);
        }
        if (uf_isNull(pTotQty) || pTotQty == 0) {
            pTotAvg = 0;
        } else {
            pTotAvg = round(pTotSaleQty / pTotQty);
        }

        ds_list.SetColumn(0, "LINE" + sLine + "A_31", pStlCnt);
        ds_list.SetColumn(0, "LINE" + sLine + "A_32", pStlAdd);
        ds_list.SetColumn(0, "LINE" + sLine + "A_33", pStlRate);
        ds_list.SetColumn(0, "LINE" + sLine + "A_34", pStlQty);
        ds_list.SetColumn(0, "LINE" + sLine + "A_35", pStlSaleQty);
        ds_list.SetColumn(0, "LINE" + sLine + "A_36", pStlAvg);
        ds_list.SetColumn(0, "LINE" + sLine + "B_31", pTotCnt);
        ds_list.SetColumn(0, "LINE" + sLine + "B_32", pTotAdd);
        ds_list.SetColumn(0, "LINE" + sLine + "B_33", pTotRate);
        ds_list.SetColumn(0, "LINE" + sLine + "B_34", pTotQty);
        ds_list.SetColumn(0, "LINE" + sLine + "B_35", pTotSaleQty);
        ds_list.SetColumn(0, "LINE" + sLine + "B_36", pTotAvg);
    }

    // 4주차 자료
    For(rCnt  = 1; rCnt < 20; rCnt++) {
		sLine = Lpad(rCnt, "0", 2);

        // 판매점수 / 증감 / 증감율
