        pPreTot = ToNumber(ds_list.GetColumn(0, "LINE" + sLine + "B_31"));
        pStlCnt = ToNumber(ds_DealIncre4th.GetColumn(0, "line" + sLine + "_stl_deal_cnt"));
        pTotCnt = ToNumber(ds_DealIncre4th.GetColumn(0, "line" + sLine + "_tot_deal_cnt"));
        pStlAdd = pStlCnt - pPreStl;
        pTotAdd = pTotCnt - pPreTot;
        if (uf_isNull(pPreStl) || pPreStl == 0) {
            pStlRate = 0;
        } else {
            pStlRate = round(pStlAdd * 100 / pPreStl, 2);
        }
        if (uf_isNull(pPreTot) || pPreTot == 0) {
            pTotRate = 0;
        } else {
            pTotRate = round(pTotAdd * 100 / pPreTot, 2);
        }

        // 판매점수 / 판매량 / 점당판매량
        pStlQty     = ToNumber(ds_DealIncre4th.GetColumn(0, "line" + sLine + "_stl_sale_deal_cnt"));
        pStlSaleQty = ToNumber(ds_DealIncre4th.GetColumn(0, "line" + sLine + "_stl_deal_sale_qty"));
        pTotQty     = ToNumber(ds_DealIncre4th.GetColumn(0, "line" + sLine + "_tot_sale_deal_cnt"));
        pTotSaleQty = ToNumber(ds_DealIncre4th.GetColumn(0, "line" + sLine + "_tot_deal_sale_qty"));
        if (uf_isNull(pStlQty) || pStlQty == 0) {
            pStlAvg = 0;
        } else {
            pStlAvg = round(pStlSaleQty / pStlQty);
        }
        if (uf_isNull(pTotQty) || pTotQty == 0) {
            pTotAvg = 0;
        } else {
            pTotAvg = round(pTotSaleQty / pTotQty);
        }

        ds_list.SetColumn(0, "LINE" + sLine + "A_41", pStlCnt);
        ds_list.SetColumn(0, "LINE" + sLine + "A_42", pStlAdd);
        ds_list.SetColumn(0, "LINE" + sLine + "A_43", pStlRate);
        ds_list.SetColumn(0, "LINE" + sLine + "A_44", pStlQty);
        ds_list.SetColumn(0, "LINE" + sLine + "A_45", pStlSaleQty);
        ds_list.SetColumn(0, "LINE" + sLine + "A_46", pStlAvg);
        ds_list.SetColumn(0, "LINE" + sLine + "B_41", pTotCnt);
        ds_list.SetColumn(0, "LINE" + sLine + "B_42", pTotAdd);
        ds_list.SetColumn(0, "LINE" + sLine + "B_43", pTotRate);
        ds_list.SetColumn(0, "LINE" + sLine + "B_44", pTotQty);
        ds_list.SetColumn(0, "LINE" + sLine + "B_45", pTotSaleQty);
        ds_list.SetColumn(0, "LINE" + sLine + "B_46", pTotAvg);
    }

    // 5주차 자료
    For(rCnt  = 1; rCnt < 20; rCnt++) {
		sLine = Lpad(rCnt, "0", 2);

        // 판매점수 / 증감 / 증감율
        pPreStl = ToNumber(ds_list.GetColumn(0, "LINE" + sLine + "A_41"));
        pPreTot = ToNumber(ds_list.GetColumn(0, "LINE" + sLine + "B_41"));
        pStlCnt = ToNumber(ds_DealIncre5th.GetColumn(0, "line" + sLine + "_stl_deal_cnt"));
        pTotCnt = ToNumber(ds_DealIncre5th.GetColumn(0, "line" + sLine + "_tot_deal_cnt"));
        pStlAdd = pStlCnt - pPreStl;
        pTotAdd = pTotCnt - pPreTot;
        if (uf_isNull(pPreStl) || pPreStl == 0) {
            pStlRate = 0;
        } else {
            pStlRate = round(pStlAdd * 100 / pPreStl, 2);
        }
        if (uf_isNull(pPreTot) || pPreTot == 0) {
            pTotRate = 0;
        } else {
            pTotRate = round(pTotAdd * 100 / pPreTot, 2);
        }

        // 판매점수 / 판매량 / 점당판매량
        pStlQty     = ToNumber(ds_DealIncre5th.GetColumn(0, "line" + sLine + "_stl_sale_deal_cnt"));
        pStlSaleQty = ToNumber(ds_DealIncre5th.GetColumn(0, "line" + sLine + "_stl_deal_sale_qty"));
        pTotQty     = ToNumber(ds_DealIncre5th.GetColumn(0, "line" + sLine + "_tot_sale_deal_cnt"));
        pTotSaleQty = ToNumber(ds_DealIncre5th.GetColumn(0, "line" + sLine + "_tot_deal_sale_qty"));
        if (uf_isNull(pStlQty) || pStlQty == 0) {
            pStlAvg = 0;
        } else {
            pStlAvg = round(pStlSaleQty / pStlQty);
        }
        if (uf_isNull(pTotQty) || pTotQty == 0) {
            pTotAvg = 0;
        } else {
            pTotAvg = round(pTotSaleQty / pTotQty);
        }

        ds_list.SetColumn(0, "LINE" + sLine + "A_51", pStlCnt);
        ds_list.SetColumn(0, "LINE" + sLine + "A_52", pStlAdd);
        ds_list.SetColumn(0, "LINE" + sLine + "A_53", pStlRate);
        ds_list.SetColumn(0, "LINE" + sLine + "A_54", pStlQty);
        ds_list.SetColumn(0, "LINE" + sLine + "A_55", pStlSaleQty);
        ds_list.SetColumn(0, "LINE" + sLine + "A_56", pStlAvg);
        ds_list.SetColumn(0, "LINE" + sLine + "B_51", pTotCnt);
        ds_list.SetColumn(0, "LINE" + sLine + "B_52", pTotAdd);
        ds_list.SetColumn(0, "LINE" + sLine + "B_53", pTotRate);
        ds_list.SetColumn(0, "LINE" + sLine + "B_54", pTotQty);
        ds_list.SetColumn(0, "LINE" + sLine + "B_55", pTotSaleQty);
        ds_list.SetColumn(0, "LINE" + sLine + "B_56", pTotAvg);
    }

    // 6주차 자료
    For(rCnt  = 1; rCnt < 20; rCnt++) {
		sLine = Lpad(rCnt, "0", 2);

        // 판매점수 / 증감 / 증감율
        pPreStl = ToNumber(ds_list.GetColumn(0, "LINE" + sLine + "A_51"));
        pPreTot = ToNumber(ds_list.GetColumn(0, "LINE" + sLine + "B_51"));
        pStlCnt = ToNumber(ds_DealIncre6th.GetColumn(0, "line" + sLine + "_stl_deal_cnt"));
        pTotCnt = ToNumber(ds_DealIncre6th.GetColumn(0, "line" + sLine + "_tot_deal_cnt"));
        pStlAdd = pStlCnt - pPreStl;
        pTotAdd = pTotCnt - pPreTot;
        if (uf_isNull(pPreStl) || pPreStl == 0) {
            pStlRate = 0;
        } else {
            pStlRate = round(pStlAdd * 100 / pPreStl, 2);
        }
        if (uf_isNull(pPreTot) || pPreTot == 0) {
            pTotRate = 0;
        } else {
            pTotRate = round(pTotAdd * 100 / pPreTot, 2);
        }

        // 판매점수 / 판매량 / 점당판매량
        pStlQty     = ToNumber(ds_DealIncre6th.GetColumn(0, "line" + sLine + "_stl_sale_deal_cnt"));
        pStlSaleQty = ToNumber(ds_DealIncre6th.GetColumn(0, "line" + sLine + "_stl_deal_sale_qty"));
        pTotQty     = ToNumber(ds_DealIncre6th.GetColumn(0, "line" + sLine + "_tot_sale_deal_cnt"));
        pTotSaleQty = ToNumber(ds_DealIncre6th.GetColumn(0, "line" + sLine + "_tot_deal_sale_qty"));
        if (uf_isNull(pStlQty) || pStlQty == 0) {
            pStlAvg = 0;
        } else {
            pStlAvg = round(pStlSaleQty / pStlQty);
        }
        if (uf_isNull(pTotQty) || pTotQty == 0) {
            pTotAvg = 0;
        } else {
            pTotAvg = round(pTotSaleQty / pTotQty);
        }

        ds_list.SetColumn(0, "LINE" + sLine + "A_61", pStlCnt);
        ds_list.SetColumn(0, "LINE" + sLine + "A_62", pStlAdd);
        ds_list.SetColumn(0, "LINE" + sLine + "A_63", pStlRate);
        ds_list.SetColumn(0, "LINE" + sLine + "A_64", pStlQty);
        ds_list.SetColumn(0, "LINE" + sLine + "A_65", pStlSaleQty);
        ds_list.SetColumn(0, "LINE" + sLine + "A_66", pStlAvg);
        ds_list.SetColumn(0, "LINE" + sLine + "B_61", pTotCnt);
        ds_list.SetColumn(0, "LINE" + sLine + "B_62", pTotAdd);
        ds_list.SetColumn(0, "LINE" + sLine + "B_63", pTotRate);
        ds_list.SetColumn(0, "LINE" + sLine + "B_64", pTotQty);
        ds_list.SetColumn(0, "LINE" + sLine + "B_65", pTotSaleQty);
        ds_list.SetColumn(0, "LINE" + sLine + "B_66", pTotAvg);
    }

    grd_list.Redraw = true;
}
